import React, { Component } from 'react';
import '../Styles/Profile.css';
import Navigation from '../Components/Navigation';
import Cities from '../static_resources/cities.png';
import Footer from '../Components/Footer';

class CityProfile extends Component {
  render() {
    return (
      <div>
        <Navigation />
        <p></p>
        <h1>City Name</h1>
        <img src={Cities} class="cover-image" />
        <p></p>
        <h4>Median Age: XX</h4>
        <h4>Number of Sunny Days: XX</h4>
        <h4>Median House Price: XX</h4>
        <h4>Crime Rate: XX</h4>
        <h4>Economic Growth: XX</h4>
        <h4>Average Education Level: XX</h4>
        <h4>Political Leaning: XX</h4>
        <h4>Diversity: XX</h4>
        <h4>Air Quality Index: XX</h4>
        <p></p>
        <Footer />
      </div>
    );
  }
}

export default CityProfile;
